<style>
            .smoke-container {
  position: fixed;
  width: 200px;
  height: 400px;
  z-index: 1000;
  top: -200px;
  left: 80px;
}

.smoke {
  position: absolute;
  bottom: 0;
  width: 80px;
  height: 180px;
  background-color: #898888;
  border-radius: 50%;
  filter: blur(15px);
  opacity: 0;
  animation: smoke-animation 5s infinite ease-in-out;
}

/* 每個煙霧有不同的延遲時間，創造自然效果 */
.smoke:nth-child(1) {
  left: 70px;
  animation-delay: 0s;
}

.smoke:nth-child(2) {
  left: 140px;
  animation-delay: 1s;
}

.smoke:nth-child(3) {
  left: 270px;
  animation-delay: 2s;
}

/* 煙霧的動畫 */
@keyframes smoke-animation {
  0% {
    transform: translateY(0) scale(1);
    opacity: 0;
  }
  50% {
    opacity: 0.7;
  }
  100% {
    transform: translateY(-300px) scale(2);
    opacity: 0;
  }
}
</style>
